package br.com.xpto.inboundai.delegate;import lombok.extern.slf4j.Slf4j;import org.camunda.bpm.engine.delegate.DelegateExecution;import org.camunda.bpm.engine.delegate.JavaDelegate;import org.springframework.stereotype.Component;@Slf4j@Component("processQualifier")public class ProcessQualifier implements JavaDelegate {	@Override	public void execute(DelegateExecution delegateExecution) throws Exception {		log.info("Process qualifier with process instance id: {}", delegateExecution.getProcessInstanceId());	}}